// import character1Image from '../../assets/images/character1.jpg';
// import character2Image from '../../assets/images/character2.jpg';
// import character3Image from '../../assets/images/character3.jpg';

function UserCreate() {
  return (
    <div className="user-create-container">
      <h2 className="user-create-container__subtitle">Multiplayer</h2>
      <h1 className="user-create-container__title">Arcade Adventure</h1>
      <ImageSlider />
      <UsernameInput />
    </div>
  );
}

export default UserCreate;
